import React from 'react'
import './Card.css';
import Todo from './Todo';
import Data from  './Data.json';


function Card() {
     const items = [];
     for(let x = 0 ; x < Data.length; x ++){
      items.push( <Todo title = {x.title} desc = {x} /> )
     }
    
  

  return (
    <div className="container">
      
          {items}
  </div>
  )
}

export default Card
